  false,\n\t\"url\": null,\n\t\"notes\": \"SWFWMD regularly uses digital topographic
  information to support regulatory, land management and acquisition, planning, engineering
  and habitat restoration projects. LiDAR data will support hydrologic modeling activities
  associated with the Federal Emergency Management Agency (FEMA), and in the creation
  of Digital Flood Insurance Rate Maps(DFIRM). The LiDAR data will support the creation
  of Federal Emergency Management Agency Flood Insurance Rate Maps (FEMA FIRM) and
  an integrated ground and surface water model for Hillsborough County. The data were
  classified into 7 classifications; (1) unclassified, (2) ground, (6) buildings,
  (9) water, (11) wetlands (reclassed by OCM to 16), (12) overlap points, (23) reserved
  for ASPRS definition (reclassed by OCM to 15), (30) reserved for ASPRS definition,
  and (31) reserved for ASPRS definition (reclassed by OCM to 10). Cooner & Associates
  performed the vertical accuracy and horizontal accuracy QA/QC analysis.\",\n\t\"license_title\":
